import React from 'react';
import Routes from './routes';
import './style.css';

import Header from './components/header';
import MainBanner from './components/mainBanner/index'
import Footer from './components/footer';

const App = () => (
  <div className="App">
    <Header />
    <MainBanner />
    <Routes />
    <Footer />
  </div>
);

export default App;
